import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Tile} from "./Tile";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Tile letter = "W" wordMultiplier={0} letterMultiplier={0}/>
        <Tile letter = "W" wordMultiplier={1} letterMultiplier={0}/>
        <Tile letter = "" wordMultiplier={0} letterMultiplier={2}/>
        <Tile letter = "" wordMultiplier={1} letterMultiplier={0}/>
      </header>
    </div>
  );
}

export default App;
